SELECT *
FROM sys.objects
WHERE name = N'12'DROP TABLE TEMP1CREATE TABLE TEMP1(NUM_STORE NUMERIC(4),CHAR_STORE VARCHAR(100),DATA_STORE DATE);--N'<schema_name,sysname,spt_values>'DECLARE@NUM INTEGER,@COUNTER INTEGER;--14BEGINSET @NUM=N'14'--SET @NUM='23'IF @NUM<25	SET @COUNTER=0;	WHILE @COUNTER<=@NUM	BEGIN		SET @COUNTER=@COUNTER+1			IF(@COUNTER=5)			INSERT INTO TEMP1(NUM_STORE,CHAR_STORE)  VALUES(5,'FIVE')			ELSE IF(@COUNTER=10)			INSERT INTO TEMP1(NUM_STORE,CHAR_STORE)  VALUES(10,'TEN')			ELSE IF(@COUNTER=15)			INSERT INTO TEMP1(NUM_STORE,CHAR_STORE,DATA_STORE)  VALUES(15,'FIFTEEN',SYSDATETIME())			ELSE IF(@COUNTER=20)			INSERT INTO TEMP1(NUM_STORE,CHAR_STORE)  VALUES(20,'TWENTY')		ELSE			INSERT INTO TEMP1(NUM_STORE) VALUES(@COUNTER)		ENDEND;SELECT* FROM TEMP1				